import React from 'react'
import { MDBContainer } from 'mdbreact';

const TextPage = () => {
  return (
    <MDBContainer>
      <p className="text-justify">                    
      <strong>ไวัรสโคโรนา (Coronavirus)</strong>
</p>
    </MDBContainer>
  )
}

export default TextPage;
